#include <gtest/gtest.h>

#include <inception_v3.hpp>

class InceptionATest : public ::testing::Test {
  protected:
    InceptionA *inception_a;

    cudaError_t cudaStatus;

    shape2d     inputShape;
    int         inputChannels;
    int         poolFeatures;
    std::string prefix = "test";

    float *d_input;
    float *d_output;

    std::vector<float> input;
    std::vector<float> expected;

    std::vector<float> branch1x1_conv_weights;
    std::vector<float> branch1x1_bn_weights;
    std::vector<float> branch1x1_bn_bias;

    std::vector<float> branch5x5_1_conv_weights;
    std::vector<float> branch5x5_1_bn_weights;
    std::vector<float> branch5x5_1_bn_bias;
    std::vector<float> branch5x5_2_conv_weights;
    std::vector<float> branch5x5_2_bn_weights;
    std::vector<float> branch5x5_2_bn_bias;

    std::vector<float> branch3x3dbl_1_conv_weights;
    std::vector<float> branch3x3dbl_1_bn_weights;
    std::vector<float> branch3x3dbl_1_bn_bias;
    std::vector<float> branch3x3dbl_2_conv_weights;
    std::vector<float> branch3x3dbl_2_bn_weights;
    std::vector<float> branch3x3dbl_2_bn_bias;
    std::vector<float> branch3x3dbl_3_conv_weights;
    std::vector<float> branch3x3dbl_3_bn_weights;
    std::vector<float> branch3x3dbl_3_bn_bias;

    std::vector<float> branchPool_2_conv_weights;
    std::vector<float> branchPool_2_bn_weights;
    std::vector<float> branchPool_2_bn_bias;

    virtual void SetUp() override {
        inception_a = nullptr;
    }

    virtual void TearDown() override {
        // Clean up
        delete inception_a;
    }

    void setBasicConv2dWeights(
        const std::vector<float> &conv_weights,
        const std::vector<float> &bn_weights,
        const std::vector<float> &bn_bias,
        const int                 index
    ) {

        std::pair<std::string, CUDANet::Layers::SequentialLayer *> layerPair =
            inception_a->getLayers()[index];

        CUDANet::Layers::Conv2d *conv =
            dynamic_cast<CUDANet::Layers::Conv2d *>(layerPair.second);
        EXPECT_NE(conv, nullptr);

        conv->setWeights(conv_weights.data());
        EXPECT_EQ(conv->getWeights().size(), conv_weights.size());

        cudaStatus = cudaGetLastError();
        EXPECT_EQ(cudaStatus, cudaSuccess);

        layerPair = inception_a->getLayers()[index + 1];
        CUDANet::Layers::BatchNorm2d *bn =
            dynamic_cast<CUDANet::Layers::BatchNorm2d *>(layerPair.second);
        EXPECT_NE(bn, nullptr);
        bn->setWeights(bn_weights.data());
        EXPECT_EQ(bn->getWeights().size(), bn_weights.size());

        cudaStatus = cudaGetLastError();
        EXPECT_EQ(cudaStatus, cudaSuccess);

        bn->setBiases(bn_bias.data());
        EXPECT_EQ(bn->getBiases().size(), bn_bias.size());

        cudaStatus = cudaGetLastError();
        EXPECT_EQ(cudaStatus, cudaSuccess);
    }

    void runTest() {
        inception_a =
            new InceptionA(inputShape, inputChannels, poolFeatures, prefix);

        // Set up layer weights and bias
        // Branch 1x1
        setBasicConv2dWeights(branch1x1_conv_weights, branch1x1_bn_weights,
                               branch1x1_bn_bias, 0);

        // Branch 5x5
        setBasicConv2dWeights(branch5x5_1_conv_weights, branch5x5_1_bn_weights,
                              branch5x5_1_bn_bias, 2);
        setBasicConv2dWeights(
            branch5x5_2_conv_weights, branch5x5_2_bn_weights,
            branch5x5_2_bn_bias, 4
        );

        // Branch 3x3dbl
        setBasicConv2dWeights(
            branch3x3dbl_1_conv_weights,
            branch3x3dbl_1_bn_weights, branch3x3dbl_1_bn_bias, 6
        );
        setBasicConv2dWeights(
            branch3x3dbl_2_conv_weights,
            branch3x3dbl_2_bn_weights, branch3x3dbl_2_bn_bias, 8
        );
        setBasicConv2dWeights(
            branch3x3dbl_3_conv_weights,
            branch3x3dbl_3_bn_weights, branch3x3dbl_3_bn_bias, 10
        );

        // Pool
        setBasicConv2dWeights(
            branchPool_2_conv_weights, branchPool_2_bn_weights,
            branchPool_2_bn_bias, 13 // 12 is pooling layer with no weights
        );

        cudaStatus =
            cudaMalloc((void **)&d_input, sizeof(float) * input.size());
        EXPECT_EQ(cudaStatus, cudaSuccess);

        cudaStatus = cudaMemcpy(
            d_input, input.data(), sizeof(float) * input.size(),
            cudaMemcpyHostToDevice
        );
        EXPECT_EQ(cudaStatus, cudaSuccess);

        d_output = inception_a->forward(d_input);

        cudaStatus = cudaGetLastError();
        EXPECT_EQ(cudaStatus, cudaSuccess);

        int                outputSize = inception_a->getOutputSize();
        std::vector<float> output(outputSize);
        cudaStatus = cudaMemcpy(
            output.data(), d_output, sizeof(float) * output.size(),
            cudaMemcpyDeviceToHost
        );
        EXPECT_EQ(cudaStatus, cudaSuccess);

        for (int i = 0; i < output.size(); ++i) {
            EXPECT_NEAR(expected[i], output[i], 1e-4f);
        }
    }
};

